import * as React from 'react';
import { deleteData, getData } from '../../config/firebase/firebasemethods';
import { useEffect } from 'react';
import { useState } from 'react';
import { Button, Table } from '@mui/material';
import SMButton from '../../config/components/button';
import { useNavigate } from "react-router-dom";
import Card from '../../config/components/card';


export default function AppData() {

  const [renderData, setrenderData] = useState([])
  const navigate = useNavigate()



  let goForm = () => {
    navigate("/form")
  }

  let getDatafunc = () => {
    getData('bookings').then((res) => {
      setrenderData(res)
      console.log(res)
    }).catch((err) => {
      console.log(err)
    })
  }


  let removeData = (xyz) => {
    console.log(`id=====>`, xyz)
    deleteData('course', xyz)
  }

  const editBtn = (data) => {
    console.log(data)
    navigate("/editform", {
      state: data
    })

  }
  useEffect(() => {

    getDatafunc()

  }, [])
  return (
    <>
      <div>AppData</div>

      <Table border='1px' className='admintable'>
        <table  >

        <thead>
          <tr class>
            <th>Full Name</th>
            <th>CNIC</th>
            <th>Date</th>
            <th>Number of person</th>
            <th>Price</th>
            <th>Services</th>
          </tr>
        </thead>
        {renderData.map((e) => {

          return (
            <>
              <tbody>
                <tr>
                  <td>{e.fullname}</td>
                  <td>{e.cnic}</td>
                  <td>{e.date}</td>
                  <td>{e.numofperson}</td>
                  <td>{e.price}</td>
                  <td>{e.service}</td>
                  <td><SMButton onClick={() => editBtn(e)} label="edit" /></td>
                  <td><SMButton onClick={() => removeData(e.id)} label="delete" /></td>
                </tr>
              </tbody>
            </>
          )
        })}
        <td><SMButton onClick={goForm} label="Add course" /></td>



        </table>
      </Table>



    </>
  )
}
